  function emsav(x,c) result(v)
    implicit none
    real*8,dimension(1:66)::x
    real*8,dimension(0:8039)::c
    real*8::v
    ! ::::::::::::::::::::
    real*8,dimension(0:8039)::p

    call bemsav(x,p)
    v = dot_product(p,c)

    return
  end function emsav

  subroutine bemsav(x,p)
    implicit none
    real*8,dimension(1:66),intent(in)::x
    real*8,dimension(0:8039),intent(out)::p
    ! ::::::::::::::::::::
    real*8,dimension(0:5402)::m

    call evmono(x,m)
    call evpoly(m,p)

    return
  end subroutine bemsav

