  !==================================!
  ! read the coefficients of the PES !
  !==================================!
  subroutine pes_init(path)
    !::::::::::::::::::
    integer::i
    character(len=1024), intent(in) :: path
    character(len=1024) :: file_path1

    file_path1 = trim(path)//"/C3H7NO/coeff.dat"
    
    open(10,file=file_path1,status='old')

    do i=1,size(coeff)
       read (10,*) coeff(i)
    end do
    close (10)
  end subroutine pes_init

  !====================================!
  ! Function to evaluate the potential !
  !====================================!
  function f(xyz)
    real*8,dimension(:,:),intent(in)::xyz
    real*8::f
    !::::::::::::::::::::::::::::::
    real*8,dimension(size(xyz,2)*(size(xyz,2)-1)/2)::x
    real*8,dimension(3)::dr
    real*8::a0  ! the same as the fitting code
    integer::i,j,k

    a0 = 2.d0

    k = 1
    do i=1,size(xyz,2)-1
       do j=i+1,size(xyz,2)
          dr = xyz(:,i) - xyz(:,j)
          x(k) = sqrt(dot_product(dr,dr))
          k = k+1
       end do
    end do

    do i=1,size(x)
       x(i)=exp(-x(i)/a0)
    end do

    f=emsav(x,coeff)

    return
  end function f

  !===========================!
  ! function to calculate the !
  ! analytical gradient       !
  !===========================!
  function g(xyz)
    real*8,dimension(:,:),intent(in)::xyz
    real*8,dimension(size(xyz,2)*3)::g
    !::::::::::::::::::::
    real*8,dimension(size(xyz,2)*(size(xyz,2)-1)/2)::r,x
    real*8,dimension(3,size(xyz,2)*(size(xyz,2)-1)/2)::dr
    real*8,dimension(size(xyz,2)*3,size(xyz,2)*(size(xyz,2)-1)/2)::drdx
    real*8,dimension(1:8040)::p   ! change to number of popynomials
                               ! (size of p in bemsa.f90)
    real*8,dimension(1:5403)::m  ! change to number of monomials
                              ! (size of m in bemsa.f90
    real*8::a0
    integer::i,j,k

    a0 = 2.d0

    k = 1
    drdx = 0.d0
    do i=1,size(xyz,2)-1
       do j=i+1,size(xyz,2)
          dr(:,k) = xyz(:,i) - xyz(:,j)
          r(k) = sqrt(dot_product(dr(:,k),dr(:,k)))

          drdx(3*i-2:3*i,k) = dr(:,k)/r(k)
          drdx(3*j-2:3*j,k) = -drdx(3*i-2:3*i,k)
          k = k+1
       end do
    end do

    do i=1,size(x)
       x(i)=exp(-r(i)/a0)
    end do

    call evmono(x,m)
    call evpoly(m,p)

    do i=1,3*size(xyz,2)
       g(i) = demsav(drdx,coeff,m,p,i)
    end do

    return
  end function g

  end module pes_shell

      subroutine pes(x,igrad,path,potential,gradient_out,dvec)

      use pes_shell
      implicit none
      ! number of electronic state
      integer, parameter :: nstates=1
      integer, parameter :: natoms=12
      integer, intent(in) :: igrad
      character(len=1024), intent(in) :: path
      double precision, intent(in) :: x(natoms,3)
      double precision, intent(out) :: potential(nstates)
      double precision, intent(out) :: gradient_out(nstates,natoms,3)
      double precision, intent(out) :: dvec(nstates,nstates,natoms,3)


      real*8 :: tx(3,natoms)
      double precision :: energy
      double precision :: grad(3*natoms)
      integer :: iatom, idir, j, istate
      !initialize 
      energy=0.d0
      gradient_out=0.d0
      dvec=0.d0

      do iatom=1,natoms
        do idir=1,3
          tx(idir, iatom)=x(iatom, idir)/0.529177211
        enddo
      enddo


      ! zero of energy: 247.471007349006 a.u. 
      ! is taken from coeff.dat, use the biase as zero of energy
      if (igrad==0) then
        call pes_init(path)
        energy=f(tx)
        do istate=1,nstates
          potential(istate)=(energy+247.471007349006)*27.211386
        enddo
      else if (igrad==1) then
        call pes_init(path)
        energy=f(tx)
        do istate=1,nstates
          potential(istate)=(energy+247.471007349006)*27.211386
        enddo
        grad=g(tx)
        do istate=1,nstates
        do iatom=1,natoms
        do idir=1,3
          j=(iatom-1)*3+idir
          gradient_out(istate,iatom,idir)=grad(j)*51.422067
        enddo
        enddo
        enddo
      else
        write (*,*) 'Only energy and gradient are available'
      endif


      endsubroutine

